import React from "react";
import "../Header/Header.scss";
import brandlogo from "../../assets/images/wrench-black-100x100.png";

function Header() {
  return (
    <>
      <header className="brand__header">
        <nav className="brand__nav">
          <ul className="brand__list">
            <li className="brand__item">
              <a href="/">Habitualr</a>
            </li>
            <li className="brand__item">Motivation</li>
            <li className="brand__item">Tracking</li>
          </ul>
        </nav>
      </header>
    </>
  );
}

export default Header;
